package cn.com.evo.integration.guangxi.pay.dto.pay.dto.query;import javax.xml.bind.annotation.XmlElement;import javax.xml.bind.annotation.XmlType;/** * @Description: * @author: lu.xin * @create: 2019-05-21 10:45 AM **/@XmlType(propOrder = {        "prodId",        "prodName",        "prodType",        "status",        "orderDate",        "tariffs",})public class ProdDto {    private String prodId;    private String prodName;    private Integer prodType;    private String status;    private String orderDate;    private Tariff tariffs;    @XmlElement(name = "prodId")    public String getProdId() {        return prodId;    }    @XmlElement(name = "prodName")    public String getProdName() {        return prodName;    }    @XmlElement(name = "prodType")    public Integer getProdType() {        return prodType;    }    @XmlElement(name = "status")    public String getStatus() {        return status;    }    @XmlElement(name = "orderDate")    public String getOrderDate() {        return orderDate;    }    @XmlElement(name = "tariffs")    public Tariff getTariffs() {        return tariffs;    }    public void setProdId(String prodId) {        this.prodId = prodId;    }    public void setProdName(String prodName) {        this.prodName = prodName;    }    public void setProdType(Integer prodType) {        this.prodType = prodType;    }    public void setStatus(String status) {        this.status = status;    }    public void setOrderDate(String orderDate) {        this.orderDate = orderDate;    }    public void setTariffs(Tariff tariffs) {        this.tariffs = tariffs;    }}